;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.machine-learning/y-java-datasets</span>","value":"#'examples.machine-learning/y-java-datasets"}
;; <=

;; **
;;; So, each of the `x` datasets, in its java form, is a 2d double array, and each of the `y` datasets is a 1d double array.
;; **

;; @@
(->> x-java-datasets
     (fmap type))
