  (->> 
    (for [model-type 	[:tree :forest]
       	   max-nodes 	[4 16]
      	   node-size	[2 4 8]
           n-trees		(case model-type
                    	  :tree [nil]
                      	  :forest [100 1000])
           mtry			(case model-type
                    	  :tree [nil]
                      	  :forest [2 3])]
		(train-and-test
    	 {:model-type 	model-type 	
      	  :max-nodes 	max-nodes 	
      	  :node-size 	node-size		
      	  :n-trees 		n-trees		
      	  :mtry 		mtry}))
    (sort-by (fn [train-and-test-results]
            			(->> train-and-test-results
                   			:results
                   			(filter #(-> % :dataset-type (= :test)))
                   			first
                  			:mean-square-error)))))


